import classNames from "classnames/bind";

import styles from "./List.module.scss";
import {  useEffect, useRef, useState } from "react";
import { getResult, deleteResult } from "../../../../Services/result";
import { toast } from "react-toastify";

const cx = classNames.bind(styles)

function ListResult() {

    const [data, SetData] = useState([]);
    const [update, SetUpdate] = useState(-1);

    const getAPI = async () => {
        try {
            const resultData = await getResult()
            SetData(resultData.data);
        } catch (error) {
            toast.error("The system is maintenance")
            console.log("error: ".error);
        }
    }

    useEffect(() => {
        getAPI();
    }, []);

    const handleDelete = async (id) => {
        try {
            const resultDelete = await deleteResult(id);
            toast.success(resultDelete.message);  
        } catch (error) {
          console.log(error);  
          toast.error("The system is maintenance")
        }
    }
    const handleUpdate =  (id) => {
        SetUpdate(id);
    }

    const Edit = (item, key) => {
        console.log(item);

        const [Name, SetName] = useState(item.item.Name);
        const [Degree, SetDegree] = useState(item.item.Degree);
        const [Date, SetDate] = useState(item.item.Date);
        const [School, SetSchool] = useState(item.item.School);
        const [Describe, SetDescribe] = useState(item.item.Describe);

        const inputRef = useRef(null);

        useEffect(() => {
            inputRef.current.focus();
        }, []);

        const handleName  = (e) => {
            SetName(e)
        }
        const handleDegree  = (e) => {
            SetDegree(e)
        }
        const handleDate  = (e) => {
            SetDate(e)
        }
        const handleSchool  = (e) => {
            SetSchool(e)
        }
        const handleDescribe  = (e) => {
            SetDescribe(e)
        }
        return(
            <tr key={key}>
                <td> <input ref={inputRef} onChange={(e) => handleName(e.target.value)} name="Name" value={Name}/></td>
                <td> <input onChange={(e) => handleDegree(e.target.value)} name="Degree" value={Degree} /></td>
                <td> <input onChange={(e) => handleDate(e.target.value)} name="Date" value={Date} /></td>
                <td> <input onChange={(e) => handleSchool(e.target.value)} name="School" value={School} /> </td>
                <td> <input onChange={(e) => handleDescribe(e.target.value)} name="Describe" value={Describe} /></td>
                <td> <button className={cx("Update")}>Update Result</button></td>
            </tr>            
        )
    }

    return (
        <section className={cx("warpper")}>
            <table className={cx("table")}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Degree</th>
                        <th>Date</th>
                        <th>School Name</th>
                        <th>Describe</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data.map((item, index) => (
                            update === item._id ? <Edit item={item} key={index}/> :
                            <tr key={index}>
                                <td>{item.Name}</td>
                                <td>{item.Degree}</td>
                                <td>{item.Date}</td>
                                <td>{item.School} Name</td>
                                <td>{item.Describe}</td>
                                <td>
                                    <button onClick={() => {handleDelete(item._id)}} className={cx("Delete")}>Delete</button>
                                    <button onClick={() => {handleUpdate(item._id)}} className={cx("Edit")}>Edit</button>
                                </td>
                            </tr>
                        ))
                    }
                </tbody>
                
            </table>
        </section>
    )
}

export default ListResult;
